import React, { useState } from 'react';
import './Logo.css';

const Logo = ({ size = 'medium', showText = true, className = '' }) => {
  const [imageError, setImageError] = useState(false);
  const [currentPath, setCurrentPath] = useState(0);

  // Try different possible paths for the logo
  const logoPaths = [
    '/images/primebuilt-logo.png',
    './images/primebuilt-logo.png',
    'images/primebuilt-logo.png',
    '/primebuilt-logo.png'
  ];

  const handleImageError = () => {
    console.error('Logo image failed to load:', logoPaths[currentPath]);
    if (currentPath < logoPaths.length - 1) {
      setCurrentPath(currentPath + 1);
    } else {
      setImageError(true);
    }
  };

  const handleImageLoad = () => {
    console.log('Logo image loaded successfully from:', logoPaths[currentPath]);
  };

  return (
    <div className={`logo ${size} ${className}`}>
      <div className="logo-icon">
        {!imageError ? (
          <img 
            src={logoPaths[currentPath]} 
            alt="PrimeBuilt Brothers Logo" 
            className="logo-image"
            onError={handleImageError}
            onLoad={handleImageLoad}
          />
        ) : (
          <div className="logo-fallback">
            <span>üè†</span>
            <small style={{ fontSize: '0.6em', display: 'block', marginTop: '2px' }}>
              Logo not found
            </small>
          </div>
        )}
      </div>
      {showText && (
        <div className="logo-text">
          <span className="logo-main">PRIMEBUILT</span>
          <span className="logo-subtitle">BROTHERS</span>
        </div>
      )}
    </div>
  );
};

export default Logo;
